import React from 'react';
import { Container } from 'react-bootstrap';
import './Contact.css';

const Contact = () => {
    return (
        <div>
            <Container>
                <div className="text-center">
                    <h2 className="title">Contact Me</h2>
                </div>
            </Container>
        </div>
    );
};

export default Contact;
